//console.log("Loading Map0DLib.js");

function Map0D() {
    this.Show=function(state,matrix,item,skeys,colkey,colvalues,rowkey,rowvalues,comp){
	var row = document.createElement("TR");
	state.Html.appendDataElement(state,row,"Not implemented","lightgray");
	item.appendChild(row);
    }
}
export default Map0D;
